import base64
import os

b64 = (
"" )

# Clean base64 string (remove spaces/newlines)
clean = ''.join(b64.split())

out_dir = os.path.join(os.path.dirname(__file__), '..', 'static')
os.makedirs(out_dir, exist_ok=True)
out_path = os.path.join(out_dir, 'logo.png')
with open(out_path, 'wb') as f:
    f.write(base64.b64decode(clean))
print('Wrote', out_path)
